import React from "react";
import "./Card.css";
export default function index() {
  return (
    <div className="card-wrapper">
      <div className="card-wrapper1">
        <i
          class="devicon-cplusplus-line-wordmark"
          style={{
            fontSize: 70,
            color: "white",
          }}
        ></i>
      </div>
      <div className="card-wrapper1">
        <i
          class="devicon-javascript-plain"
          style={{
            fontSize: 70,
            color: "white",
          }}
        ></i>
      </div>
    </div>
  );
}
